    false,nt"url": null,nt"notes": "As suggested by the GIS Technical Advisory
    Committees DASC subcommittee, the DASC staff has imported and converted the U.S.
    Bureau of Census 2000 TIGER Line files and Summary File 1 (SF1) data into ESRI's
    ArcView shapefile format. The purpose of this conversion was to derive a subset
    of shapefiles from the TIGER files that would be of wide use by DASC clientele.
    These shapefiles reflect only a portion of the possible themes that could be created
    from TIGER and serve as a common ground for all to work from and should be customized
    for each user's individual needs. Additional documentation is provided for any shapefiles
    that have been edited from the original TIGER line files. DASC TIGER shapefiles
    are provided "as-is" - please submit any corrections or errors to DASC so the
    dataset can be corrected.",nt"license_title": null,nt"extras": [{ntt"key":
